function App() {
  return (
    <React.Fragment>
      <div className="App p-4 container-fluid" >
        <h1 className="title">Cryptocurrency Search</h1>
      </div>
      <div>
        <div className="col-md-12 d-flex justify-content-center p-7" style={{ backgroundColor: "red" }}>
          <input type="text" Placeholder="Input Bitcoin" className="w-25" />
          <br />
          <button>Search</button>
        </div>



      </div>
    </React.Fragment>
  );
}

export default App;
